><td class="first-column"><span class="context-help tooltipped-click"><span class="toolTipContent" style="display:none">&lt;p>Shows the date of integration of the entry into UniProtKB, the date of the last sequence update and the date of the last annotation modification (â€˜Last modifiedâ€™). The version number for both the entry and the &lt;a href="help/canonical_and_isoforms">canonical sequence&lt;/a> are also displayed.&lt;/p>&lt;p>&lt;a href='../manual/entry_history' target='_top'>More...&lt;/a>&lt;/p></span>Entry history<sup>i</sup></span></td><td><table class="nestedEntryTable"><tr><td style="width: 30%;">Integrated into UniProtKB/TrEMBL: </td><td><span property="schema:dateCreated">July 5, 2004</span></td></tr><tr><td style="width: 30%;">Last sequence update: </td><td>July 5, 2004</td></tr><tr><td style="width: 30%;">Last modified: </td><td><span property="schema:dateModified">September 7, 2016</span></td></tr><tr><td style="width: 30%;" colspan="2">This is version <span property="schema:version">120</span> of the entry and version 1 of the sequence.   [<a href="/uniprot/Q7KTN9?version=*">Complete history</a>]</td></tr></table></td></tr><tr><td class="first-column"><span class="context-help tooltipped-click"><span class="toolTipContent" style="display:none">&lt;p>Indicates whether the entry has been manually annotated and reviewed by UniProtKB curators or not, in other words, if the entry belongs to the Swiss-Prot section of UniProtKB (&lt;strong>reviewed&lt;/strong>) or to the computer-annotated TrEMBL section (&lt;strong>unreviewed&lt;/strong>).&lt;/p>&lt;p>&lt;a href='../manual/entry_status' target='_top'>More...&lt;/a>&lt;/p></span>Entry status<sup>i</sup></span></td><td>Unreviewed (UniProtKB/TrEMBL)</td></tr></table></div><div class="section " id="miscellaneous"><h2><span class="context-help tooltipped-click"><span class="toolTipContent" style="display:none">&lt;p>Contains any relevant information that doesnâ€™t fit in any other defined sections&lt;/p>&lt;p>&lt;a href='../manual/miscellaneous_section' target='_top'>More...&lt;/a>&lt;/p></span>Miscellaneous<sup>i</sup></span></h2><h4><span class="context-help tooltipped-click"><span class="toolTipContent" style="display:none">&#xd;
&lt;p>UniProtKB Keywords constitute a &lt;a target="_top" href="/keywords">controlled vocabulary&lt;/a> with a hierarchical structure. Keywords summarise the content of a UniProtKB entry and facilitate the search for proteins of interest.&lt;p>&lt;a href='/help/keywords' target='_top'>More...&lt;/a>&lt;/p></span>Keywords - Technical term<sup>i</sup></span></h4><span><a href="/keywords/KW-0181">Complete proteome</a>, <a href="/keywords/KW-1267">Proteomics identification</a><span class="attribution ECO213"><span class="attributionHeader ">Combined sources<span class="showHideEvidence caret_grey displayThisInline"></span></span><div style="display:none" class="evidenceContainer"><p class="attributionExplain"><span class="context-help tooltipped-click"><span class="toolTipContent" style="display:none">&#xd;
