	&lt;p>&lt;a href="/manual/evidences#ECO:0000313">Moreâ€¦&lt;/a>&lt;/p>      </span>Automatic assertion inferred from database entries<sup>i</sup></span></p><ul><li><a href="http://www.uniprot.org/proteomes/UP000000803">Proteomes:UP000000803</a></li></ul></div></span></span></div><div class="section " id="similar_proteins"><h2><span class="context-help tooltipped-click"><span class="toolTipContent" style="display:none">&lt;p>Provides links to the UniProt Reference Clusters (&lt;a href="/help/uniref">UniRef&lt;/a>). UniRef consists of clusters for UniProtKB sequences (including isoforms) and selected UniParc sequences, in order to obtain complete coverage of the sequence space at resolutions of 100%, 90% and 50% identity.&lt;/p>&lt;p>&lt;a href='../manual/similar_proteins_section' target='_top'>More...&lt;/a>&lt;/p></span>Similar proteins<sup>i</sup></span></h2><span>Links to similar proteins from the UniProt Reference Clusters (UniRef) at 100%, 90% and 50% sequence identity:</span><table><tr><td><a href="/uniref/?query=uniprot:Q7KTN9*&amp;fil=identity:1.0&amp;sort=score">100%</a></td><td>UniRef100 combines identical sequences and sub-fragments with 11 or more residues from any organism into one UniRef entry.</td></tr><tr><td><a href="/uniref/?query=uniprot:Q7KTN9*&amp;fil=identity:0.9&amp;sort=score">90%</a></td><td>UniRef90 is built by clustering UniRef100 sequences that have at least 90% sequence identity to, and 80% overlap with, the longest sequence (a.k.a seed sequence).</td></tr><tr><td><a href="/uniref/?query=uniprot:Q7KTN9*&amp;fil=identity:0.5&amp;sort=score">50%</a></td><td>UniRef50 is built by clustering UniRef90 seed sequences that have at least 50% sequence identity to, and 80% overlap with, the longest sequence in the cluster.</td></tr></table></div></div></div><a property="schema:author schema:publisher" href="/help/about#UniProt" style="display:none"></a><link href="http://ebi-uniprot.github.io/CDN/protvista/css/main.css" rel="stylesheet"/><script sr